import React from 'react';
import { Box, Container, Button, Grid, Paper } from '@mui/material';
import { makeStyles } from '@material-ui/core';

import Hero from '../../Hero/Hero';
import Footer from '../../Footer/Footer';

const useStyles = makeStyles((theme) => ({
  textContent: {
    alignSelf: 'center',
    marginTop: '0px',
    paddingLeft: theme.spacing(5),
  },
  buttons: {
    display: 'flex',
  },
  button: {
    padding: theme.spacing(1),
    margin: theme.spacing(1),
    textAlign: 'center',
    alignSelf: 'center',
  },
  card: {
    backgroundColor: '#999',
    margin: '15px 15px 0px 15px',
  },
}));

const Projects = (props) => {
  const classes = useStyles();

  const heading = 'Projects';
  const caption = 'This is my Projects';
  const image =
    'https://images.pexels.com/photos/372787/pexels-photo-372787.jpeg?cs=srgb&dl=pexels-pixabay-372787.jpg&fm=jpg';
  const btnLeft = 'Education';
  const btnRight = 'Contact';
  return (
    <Box>
      <Hero
        heading={heading}
        caption={caption}
        image={image}
        btnLeft={btnLeft}
        btnRight={btnRight}
      />
      <Container maxWidth="lg">
        <Paper className={classes.card} elevation={3}>
          <Grid container xs={12}>
            <Grid item xs={9} className={classes.textContent}>
              <Box>
                <h2>Macros Calculator</h2>
                <p>Bachelors of Science: Mechanical Engineering</p>
                <p>3.95 GPA</p>
              </Box>
            </Grid>
            <Grid className={classes.buttons} item xs={3}>
              <Button className={classes.button} variant="contained">
                View
              </Button>
              <Button className={classes.button} variant="contained">
                GitHub
              </Button>
            </Grid>
          </Grid>
        </Paper>
      </Container>

      <Footer />
    </Box>
  );
};

export default Projects;
